let authState = {
    isLoggedin: false,
    name: "",
    email: "",
    mobile: ""
}

videosState = {
    searchHistory: [],
    videos: [],
    played: [],
    bookmarked: []
}

export function authReducer(state = authState, action) {
    switch (action.type) {
        default:
            return state
    }
}
export function videoReducer(state = videosState, action) {
    switch (action.type) {
        default:
            return state
    }
}
